const fetch = require('node-fetch');       

function Modif(query,cb) {
    return fetch(`http://localhost/api/modifica?q=${query}`,{method: 'PUT'})
        .then(res => res.text())
        .then(cb);
   }
  
const ClientModifica = { Modif }; 
export default ClientModifica;
